import React from 'react';
import './shipping.css';

const Shipping = () => {
  return (
    <div className="shipping-container">
      <h2 className="shipping-container__tittle">Địa chỉ giao hàng</h2>
      <h4 className="shipping-container__options">Chọn địa chỉ giao hàng</h4>
      <div className="address-list">
        <p className="shipping__name">Lê bá</p>
        <p className="shipping__address">Đây là địa cỉh</p>
        <p className="shipping__phone">Đây là số điện thoại</p>
        <button type="button" class="btn saving-address">
          Giao đến địa chỉ này
        </button>
        <button type="button" class="btn edit-address">
          Sửa
        </button>
      </div>
    </div>
  );
};

export default Shipping;
